import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const Navbar = () => {

  return (
    <div>
      <div>
        <ul className="ulnav">
          <li><Link className="links" to="/home">Home</Link></li>
          <li><Link className="links" to="/termekek">Autok</Link></li>
          <li><Link className="links" to="/rolunk">Rolunk</Link></li>
          </ul>
          <ul className="ulnav" id="">
          <li><Link className="links" to="/reg">Reg</Link></li>
          <li><Link className="links" to="/login">Login</Link></li>
        </ul>
      </div>
    </div>
  );
};
export default Navbar;
